class Solution(object):    def find132pattern(self, nums):        """        :type nums: List[int]        :rtype: bool        """        stack=[]        index=-float("inf")        for n in nums[::-1]:            if n<index:                return True            while stack and stack[-1]<n:                index=stack.pop()            stack.append(n)        return Falses=Solution()nums=[3,5,0,3,4]print(s.find132pattern(nums))#对于stack的使用 仅O(n)